__NUXT_JSONP__("/drugs/Morpholinodoxorubicin", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"89196-04-3",chebiId:b,chemicalFormula:b,definition:"A semisynthetic derivative of the anthracycline antineoplastic antibiotic doxorubicin.  As an antineoplastic agent, morpholinodoxorubicin is more potent than doxorubicin.  Similar to doxorubicin, morpholinodoxorubicin intercalates into DNA and causes single- and double-strand breaks in DNA via inhibition of topoisomerase I and II.  Unlike doxorubicin, this agent is metabolized in vivo to a DNA-alkylating derivative that forms DNA interstrand cross-links, thereby potentiating its doxorubicin-like cytotoxicity.",fdaUniiCode:"X0N4EFN4AI",identifier:"C1442",preferredName:a,semanticType:"Antibiotic",subclassOf:["C1594"],synonyms:["5,12-Naphthacenedione, 7, 8, 9, 10-tetrahydro-6, 8, 11-trihydroxy-8-(hydroxyacetyl)-1-methoxy-10-[[2, 3, 6-trideoxy-3-(4-morpholinyl)-alpha-L-lyxo-hexopyranosyl] oxy]-, hydrochloride, (8S-cis)-","MORPHOLINODOXORUBICIN",a,"morpholino-ADR","morpholino-adriamycin"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FMorpholinodoxorubicin",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Morpholinodoxorubicin","","2021-10-30T13:32:43.863Z")));